import React from "react";
import {useTheme} from "@material-ui/core";
import Grid from "@material-ui/core/Grid";

const HomePage = () => {
    const theme = useTheme()

    return (
        <Grid container justify="center" alignItems="center" style={{color: theme.palette.text.primary}}>
            <Grid item xs={6}> This is simple platform game created using phaser3 javaScript engine.
            </Grid>
        </Grid>
    )
}
export default HomePage;
